import React from 'react'
import './title.css'
import logo from './logo.png'

const Title = () => {
  return (
    <div className="border d-flex align-items-center justify-content-center">
      <img src={logo}/>
      <h3>your biosecurity budy</h3>
    </div>
  )
}

export default Title
